Family Party: 30 Great Games Winter Fun delivers hours of family entertainment
on Wii where layers can choose from over a dozen cute characters dressed head-
to-toe in customizable winter outfits, and can participate in up to four
player action including multiplayer co-op. Players will be getting in the
spirit of playing all-time favorite winter games and competing and unlocking
games and challenges to achieve high scores and win medals!
